  `error_msg` varchar(2000) DEFAULT '' COMMENT '',
  `oper_time` datetime DEFAULT NULL COMMENT '',
  PRIMARY KEY (`oper_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=355 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='';

